  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0110379 includes discrete
  sample and profile data collected from RRS JAMES COOK in the South Atlantic Ocean,
  South Pacific Ocean and Southern Oceans (> 60 degrees South) from 2009-02-03 to
  2009-03-03. These data include DISSOLVED INORGANIC CARBON (DIC), DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE, SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE,
  phosphate and silicate. The instruments used to collect these data include Alkalinity
  titrator, CTD, Coulometer for DIC measurement and bottle.nnThese data were collected
  by Dorothee C. E. Bakker of University of East Anglia; School of Environmental Sciences
  as part of the CLIVAR_A21_JC031_2009 data set. CDIAC associated the following cruise
  ID(s) with this data set: CLIVAR_A21_JC031_2009nnThe International CLIVAR Global
  Ocean Carbon and Repeat Hydrography Program carries out a systematic and global
  re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes in
  storage and transport of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"license_title\":
